import React from 'react';
import { Link } from 'react-router-dom';

function LoginPage() {
  return (
    <div>
      <h1>로그인 페이지</h1>
      {/* 영화 선택 페이지로 이동하는 버튼 */}
      <Link to="/movie-select"><button>로그인하기</button></Link>
      {/* 회원가입 페이지로 이동하는 버튼 */}
      <Link to="/signin"><button>회원가입하기</button></Link>
    </div>
  );
}

export default LoginPage;
